package main

import "fmt"

func main() {

	colors := ""
	result := winnerOfGame(colors)
	fmt.Printf("%v\n", result)
}

func winnerOfGame(colors string) bool {
	if len(colors) < 3 {
		return false
	}

	index := -1
	// fmt.Printf("colors %s\n", colors)
	for len(colors) >= 3 {
		// alice
		// fmt.Println("ALICE")
		index = play(colors, 'A')
		if index > 0 {
			// fmt.Printf("ALICE removed %d\n", index)
			colors = colors[:(index-1)] + colors[index:]
			// fmt.Printf("colors %s\n", colors)
		} else {
			// fmt.Println("BOB WINS")
			return false
		}

		// bob
		// fmt.Println("BOB")
		index = play(colors, 'B')
		if index > 0 {
			// fmt.Printf("BOB removed %d\n", index)
			colors = colors[:(index-1)] + colors[index:]
			// fmt.Printf("colors %s\n", colors)
		} else {
			// fmt.Println("ALICE WINS")
			return true
		}

	}

	return false
}

// given a color, return the index if the play was possible, otherwise -1
func play(colors string, color rune) int {
	if len(colors) < 3 {
		return -1
	}
	for i := 1; i < len(colors)-1; i++ {
		// fmt.Printf("[%s][%s][%s]\n", string(colors[i-1]), string(colors[i]), string(colors[i+1]))
		if rune(colors[i-1]) == color && rune(colors[i]) == color && rune(colors[i+1]) == color {
			// fmt.Println("found")
			return i
		}
	}
	return -1
}
